import React from "react";

export function Submit(props) {
  return (
    <div className="form-group text-right m-t-20">
      <div className="col-xs-12">
        <button
          className="btn btn-success"
          type="submit"
          onSubmit={props.onSubmit}
        >
          Submit Issue
        </button>
      </div>
    </div>
  );
}
